import React from "react";
import "./PostItem.css";

const PostItem = ({ post }) => {
  return (
    <div className="post-item">
      <h3 className="post-title">{post.title}</h3>
      <p className="post-content">{post.content}</p>
      <span className="post-category">{post.category}</span>
    </div>
  );
};

export default PostItem;
